DROP TABLE IF EXISTS `api_token_usage`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `api_token_usage` (
  `id` int NOT NULL AUTO_INCREMENT,
  `token_id` int NOT NULL,
  `endpoint` varchar(255) COLLATE utf8mb4_general_ci NOT NULL,
  `method` varchar(10) COLLATE utf8mb4_general_ci NOT NULL,
  `ip_address` varchar(45) COLLATE utf8mb4_general_ci NOT NULL,
  `user_agent` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `status_code` int NOT NULL,
  `response_time` int DEFAULT NULL,
  `error_message` text COLLATE utf8mb4_general_ci,
  `created_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `token_id` (`token_id`),
  KEY `ix_api_token_usage_id` (`id`),
  CONSTRAINT `api_token_usage_ibfk_1` FOREIGN KEY (`token_id`) REFERENCES `api_tokens` (`id`)
